import './Navbar.css';
import logo from '../../logo.svg';

export default function Navbar() {
    return (
        <div>
           <header className="flex justify-between bg-violet-500">
             <a href="index.html">
               <img src={logo} className="App-logo" alt="logo" width="50" height="50"/>
             </a>
             <nav>
              <ul className="flex text-white">
                <li className="nav__item">Home</li>
                <li className="nav__item">Features</li>
                <li className="nav__item">Contact</li>
                <li className="nav__item">Sign In</li>
                <li className="nav__item bg-violet-100 p-2">Sign Up</li>
              </ul>
             </nav>
           </header>
        </div>
    );
}
